(function() {
  var Class;

  Class = (function() {
    class Class {
      log(...args) {
        if (!this.trace) {
          return;
        }
        if (typeof console === 'undefined') {
          return;
        }
        args.unshift(`[${this.constructor.name}]`);
        console.log(...args);
        return this;
      }

      logStart(name, ...args) {
        if (!this.trace) {
          return;
        }
        this.logtimers || (this.logtimers = {});
        this.logtimers[name] = +(new Date);
        if (args.length > 0) {
          this.log(`${name}`, ...args, "(started)");
        }
        return this;
      }

      logEnd(name, ...args) {
        var ms;
        ms = +(new Date) - this.logtimers[name];
        this.log(`${name}`, ...args, `(Done in ${ms}ms)`);
        return this;
      }

    };

    Class.prototype.trace = true;

    return Class;

  }).call(this);

  window.Class = Class;

}).call(this);


